import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/UpgradeableProxy.sol";
import "@openzeppelin/contracts/access/TimelockController.sol";
import "../interfaces/IUniverseVault.sol";
import "./UniversePairVaultStorage.sol";

contract UniversePairVaultDelegate is
    Ownable,
    UpgradeableProxy,
    UniversePairVaultBaseStorage
{
    constructor(
        address _vaultAddress,
        address payable _timelock,
        bytes memory _data
    ) UpgradeableProxy(_vaultAddress, _data) {
        timelock = TimelockController(_timelock);
    }

    function upgrade(address _vaultAddress) external {
        require(_vaultAddress != address(0), "ZERO");
        require(msg.sender == address(timelock), "forbidden");
        _upgradeTo(_vaultAddress);
    }
}
